import React from './node_modules/react';
import Link from "react-router-dom";

const navbar = () => {
    return (
        <nav>
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/about">About</Link>
              </li>
              <li>
                <Link to="/users">Users</Link>
              </li>
            </ul>
        </nav>
    )
}

export default navbar;
